    return (
        <section className='homeWidgets'>
            <table className='widgettable'>
                <thead>
                <tr className='widgetmember'>
                    <th className='widgetmemberid'>id</th>
                    <th className='widgetmembername'>이름</th>
                    <th className='widgetmemberid'>전화번호</th>
                    <th className='widgetmembername'>이메일</th>
                    <th className='widgetmembername'>상세보기</th>
                </tr>
                </thead>
                <tbody>
                <tr className='widgetmember'>
                    <td className='widgetmemberid'>minwoo405</td>
                    <td className='widgetmembername'>양민우</td>
                    <td className='widgetmemberid'>010-1234-1234</td>
                    <td className='widgetmembername'>gsjlg@gmail.com</td>
                    <td><button className='widgetbtn'>detail</button></td>
                </tr>
                </tbody>
            </table>
        </section>
    );
};

export default AdminMemberList;
